Product Description The Melissa & Doug K’s Kids Pull-Back Vehicle Set introduces little ones to motion, cause-and-effect play, and hands-on exploration. This soft baby toys set includes four vehicles—a school bus, family car, fire truck, and police car—sized just right for small hands to grasp, pull back, and release. With a built-in rev-up mechanism, the vehicles zoom across the floor, turning floor time into an active adventure that promotes crawling, coordination. The pull-and-release action strengthens fine motor skills, while the bright colors and friendly details encourage sensory engagement and storytelling. (Do Not Leave In Crib Unattended) Multiple toy trucks & cars invite sharing, cooperative play, and early conversations about familiar community helpers, making this set a tool for both cognitive and social growth. Soft fabric exteriors keep play safe, while removable wheel inserts and washable surfaces make cleanup simple. Designed for open-ended, screen-free fun, these vehicles inspire endless races, rescues, and imaginative road trips. For even more meaningful developmental play, combine this with other Melissa and Doug toys for babies & baby stuff like the hungry pelican, Burrow bunny stuffed animal & must-have Montessori toys! For 35+ years, Melissa and Doug has crafted imaginative preschool toys and durable wooden toys built to nurture childhood wonder, with everything from a life-sized grocery store playset to a play kitchen playset and play food to serve plush toys & puppets, to costumes, arts & crafts, and road trip activities for kids. It’s the kind of kid-powered play that builds independence and confidence! Brand Story By P.when('A').execute(function(A) {
